// Register.js

import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // If you’re using React Router
import { toast } from 'react-toastify';

import styles from './Register.module.css';
import { register } from '../services/api';

const Register = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await register({ username, password });
      // Maybe navigate to the login page or your main dashboard
      navigate('/login');
    } catch (error) {
      // If an error is thrown, you have already handled it in api.js
      // but you could do something else here if you wanted (e.g., highlight fields).
    }
  };

  return (
    <div className={styles.registerPage}>
      <div className={styles.registerContainer}>
        <form className={styles.registerForm} onSubmit={handleSubmit}>
          <h2>Create Your Account</h2>
          <p>Join us and start your fitness journey today!</p>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            placeholder="Enter your username"
            required
            className={styles.inputField}
          />
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="Enter your password"
            required
            className={styles.inputField}
          />
          <button type="submit" className={styles.registerButton}>Register</button>
        </form>
      </div>
    </div>
  );
};

export default Register;
